.button{
font-family: Roboto, sans-serif;
font-weight: 500;
font-size: 100px;
color: #fff;
background-color: #000000;
padding: 10px 30px;
border: solid #000000 2px;
box-shadow: rgba(0, 0, 0, 0.2) 0px 20px 30px;
border-radius: 15px;
transition : 350ms;
transform: translateY(0);
flex-direction: row;
align-items: center;
cursor: pointer;
display: block;
margin: 0 auto;
}

.button:hover{
transition : 350ms;
padding: 10px 22px;
transform : translateY(-5px);
background-color: #000000;
color: #ffffff;
border: none;
}

body {
  display: flex;
  align-items: center;
  justify-content: center; /* Optional for horizontal centering */ /* Ensure full viewport height */
  height: 100vh;
  width: 100vw;
}

        function setText(text){
            document.getElementById('md5_value').innerText = text;
